import React, { FunctionComponent } from "react";
import { Link } from "react-router-dom";

type LinkProps = {
    href: string;
    className: string;
    children: string;
};

const LinkComponent: FunctionComponent<LinkProps> = ({
    href,
    className,
    children,
}) => (
    <li>
        <Link to={href} className={className}>
            {children}
        </Link>
    </li>
);

export default LinkComponent;
